import { makeStyles } from "@material-ui/core";
import {React} from "react";
import SideMenu from "../components/SideMenu";
import './App.css';

const useStyles = makeStyles({
  AppRight:{
    position: 'absolute',
    left: '235px',
    width: '100%'
  }
})


function App() {
  const classes = useStyles();

  return (
    <>
        <SideMenu />
        <div className={classes.AppRight}> Here we go</div>
    </>
  );
}

export default App;
